import Header from '@components/manager/partials/Header';
import Sidenav from '@components/manager/partials/Sidenav';
function Layout({ children }) {

    return (
        <>
        <Sidenav/>
        <Header/>
        <div class="container-fluid py-4">
            { children }
        </div>
        </>
    );
}

export default Layout;
